import React from "react";
import logements from "../../data/logements.json"

export default function Details(props, imageid){
    const currentImage = logements.filter(logement =>
        logement.id === imageid)


    return(
        currentImage.map(titre =>
        <h1>{props.titre.title}</h1>)
    )
}
